import "../index.css"
export default function Header(){

    return(
    <div style={{
        float:"left"
    }} className="konkuk_pic">
        
        <img   alt="konkuk_pic" src={konkukPic}></img>
        <text>수강신청 연습시스템</text>
    </div>
    )
    
}//103 30
